import React, { useState } from 'react';
import Paper from '@material-ui/core/Paper';
import TextField from '@material-ui/core/TextField';

import {MuiPickersUtilsProvider, KeyboardDatePicker } from '@material-ui/pickers';
import DateFnsUtils from '@date-io/date-fns';
import fiLocale from 'date-fns/locale/fi';



function UusiTilaus () {

    const [tuote, setTuote] = useState('');
    const muutaTuote = (e) => {
    setTuote(e.target.value);
    };

    const [tilauspaiva, setTilauspaiva] = useState(new Date());
    const muutaPaiva = (date) =>{
        setTilauspaiva(date);
    };

    const [toimpaiva, setTPaiva] = useState(null);
    const muutaTPaiva = (date) => {
        setTPaiva(date);
    };

    const [hinta, setHinta] = useState('');
    const muutaHinta = (e) => {
    setHinta(e.target.value);
    };    

    return (
        <div>
            <Paper>
                <form>
                <TextField 
                fullWidth 
                label='Tuote' 
                variant='outlined'
                value={tuote}
                onChange = {(e) => muutaTuote}/>
                <MuiPickersUtilsProvider utils={DateFnsUtils} locale={fiLocale}>
                    <KeyboardDatePicker label='Tilausp채iv채' name='tilauspaiva'
                    fullWidth={true} required
                    value={tilauspaiva}
                     onChange={muutaPaiva}
                    format='dd.MM.yyyy' />
                </MuiPickersUtilsProvider>

                <MuiPickersUtilsProvider utils={DateFnsUtils} locale={fiLocale}>
                    <KeyboardDatePicker label='Toimitusp채iv채' name='toimpaiva'
                    fullWidth={true} required
                    value={toimpaiva}
                     onChange={muutaTPaiva}
                    format='dd.MM.yyyy' />
                </MuiPickersUtilsProvider>

                <TextField 
                fullWidth 
                label='Hinta' 
                variant='outlined'
                value={hinta}
                onChange = {(e) => muutaHinta}/>

                </form>
            </Paper>
        </div>
    )
};
export default UusiTilaus;
